    code(`const electron = require('electron');

    const app = electron.app;
    const BrowserWindow = electron.BrowserWindow;
    
    var mainWindow = null;
    
    app.on('ready', () => {
        // 窗体样式设置
        mainWindow = new BrowserWindow({
            width: 600,
            height: 300
        });
    
        // 将HTML加载至窗口
        mainWindow.loadFile('./index.html');
    
        // 当窗口关闭时清理窗口
        mainWindow.on('closed', () => {
            mainWindow = null;
        });
    });`);

